import React from 'react';

class List extends React.Component {
    render()
    {
        return (
            <div>
                <img id='image' src="https://g.foolcdn.com/editorial/images/529555/bitcoin-gettyimages-1130794858.jpg"></img><br></br>
                <select id="list">
                    <option>Биткоин</option>
                    <option>Эфириум</option>
                    <option>Tether</option>
                    <option>BNB</option>
                </select>
            </div>
        )
    }
}
export default List
